import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

export default function Preview() {
  const location = useLocation();
  const navigate = useNavigate();

  // 전달된 데이터 구조 확인
  const { formData, costs } = location.state || {};

  if (!formData || !costs) {
    return (
      <div style={{ padding: 20 }}>
        <h2>잘못된 접근입니다.</h2>
        <button onClick={() => navigate("/")}>돌아가기</button>
      </div>
    );
  }

  return (
    <div style={{ maxWidth: 900, margin: "20px auto", fontFamily: "Pretendard, 'Segoe UI', sans-serif" }}>
      <h1 style={{ textAlign: "center", color: "#1a2e59" }}>견적서 미리보기</h1>

      <p><strong>회사명:</strong> {formData.company}</p>
      <p><strong>문서번호:</strong> {formData.doc_number}</p>

      <table style={{ width: "100%", borderCollapse: "collapse", marginTop: 20 }}>
        <thead>
          <tr style={{ backgroundColor: "#3f72af", color: "white" }}>
            <th style={{ padding: 10 }}>항목</th>
            <th style={{ padding: 10 }}>금액</th>
          </tr>
        </thead>
        <tbody>
          {formData.includeBase && (
            <tr>
              <td style={{ padding: 10 }}>거래구조 및 과세자료 제출 범위 검토</td>
              <td style={{ padding: 10, textAlign: "right" }}>{costs.baseCost.toLocaleString()} 원</td>
            </tr>
          )}
          {formData.includeReason && (
            <tr>
              <td style={{ padding: 10 }}>과세자료 미제출 사유서 작성 지원</td>
              <td style={{ padding: 10, textAlign: "right" }}>{costs.reasonCost.toLocaleString()} 원</td>
            </tr>
          )}
          {formData.includeDoc && (
            <tr>
              <td style={{ padding: 10 }}>과세자료 제출 서류 정비 및 전자제출 대행</td>
              <td style={{ padding: 10, textAlign: "right" }}>{costs.docCost.toLocaleString()} 원</td>
            </tr>
          )}
          {formData.includeReport && (
            <tr>
              <td style={{ padding: 10 }}>
                과세가격 결정 사유 보고서 작성 (
                {Object.entries(formData.reportItems)
                  .filter(([key, val]) => val)
                  .map(([key]) => key)
                  .join(", ")}
                )
              </td>
              <td style={{ padding: 10, textAlign: "right" }}>{costs.reportCost.toLocaleString()} 원</td>
            </tr>
          )}
          {formData.includeRelated && (
            <tr>
              <td style={{ padding: 10 }}>특수관계자 거래 분석 및 이전가격 검토 리포트</td>
              <td style={{ padding: 10, textAlign: "right" }}>{costs.relatedCost.toLocaleString()} 원</td>
            </tr>
          )}
        </tbody>
        <tfoot>
          <tr>
            <th style={{ padding: 10, textAlign: "right" }}>총 합계</th>
            <th style={{ padding: 10, textAlign: "right" }}>{costs.totalCost.toLocaleString()} 원</th>
          </tr>
        </tfoot>
      </table>

      <button
        style={{
          backgroundColor: "#3f72af",
          color: "white",
          border: "none",
          borderRadius: 12,
          padding: "12px 36px",
          cursor: "pointer",
          display: "block",
          margin: "20px auto",
          fontWeight: "700",
          fontSize: 16,
        }}
        onClick={() => navigate(-1)}
      >
        돌아가기
      </button>
    </div>
  );
}
